import logo from './logo.svg';
import './App.css';
import TodoList from './TodoList';
import React, {useState} from 'react';

function App() {
  const [todos, setTodos] = useState([{
    id: 1,
    name: "todo 1",
    complete: "false"
  }]);
  return (
    <>
      <TodoList todoList={todos}/>
      <input type="text"/>
      <button>
        Add todo
      </button>
      <button>
        Clear completes todos
      </button>

      <div>0 left to do</div>
    </>
  );
}

export default App;
